import s from "./SaleCenter.module.css";
import {NavLink} from "react-router-dom";

const Menu = () => {
    return (
        <div className={s.sale_center_right_menu}>
            <div className={s.sale_center_right_menu_name}>Наше меню</div>
            <ul className={s.sale_center_right_menu_menu}>
                <li><NavLink to="/profile/pizza" className={s.pizza} activeClassName={s.ac}>Пица</NavLink>
                </li>
                <li><NavLink to="/profile/sneks" className={s.snek} activeClassName={s.ac}>Снеки</NavLink>
                </li>
                <li><NavLink to="/profile/drink" className={s.drink} activeClassName={s.ac}>Напої</NavLink>
                </li>
                <li><NavLink to="/profile/sous" className={s.sous} activeClassName={s.ac}>Соуси</NavLink>
                </li>
            </ul>
        </div>
    )
}
export default Menu
